import Item from "./Item.js";

const ListDelete = ({ add, listData, deleteData, submittingstatus }) => {
  return (
    <div className="pt-10 text-white">
      <p>Finished Tasks :</p>

      {listData.map((item) => {
        const { id, note, date, time } = item;
        return (
          <Item
            key={id}
            id={id}
            note={note}
            date={date}
            time={time}
            deleteData={deleteData}
            submittingstatus={submittingstatus}
            add={add}
            listData={listData}
            item={item}
          />
        );
      })}
    </div>
  );
};

export default ListDelete;
